        //     </h1>
        // </div>
        <div>
            <h1>
                {
                    Quotes.map( q => {
                        return (
                            <div>
                                { q.author }
                            </div>
                        )
                    })
                }
            </h1>
        </div>
    // );
};

export default Quote;
